import React from 'react';
import Navbarin from '../components/Navbarin.js';
import {Form} from 'react-bootstrap';
import {Button} from 'react-bootstrap';
import {Container, Col, Row} from 'react-bootstrap';
import GridLayout from 'react-grid-layout';


export default class Profile extends React.Component {

    LoggedInPage() {
        return (
            <div>
                <Navbarin/>
                <div id="loggedInDiv">
                    <br/>
                    <Container>
                        <br/>
                        <GridLayout className="layout" cols={3} rowHeight={380} width={1200}>
                            <div outline="2px dashed blue" key="payment" data-grid={{x: 0, y: 0, w: 2, h: 1, static: true}}>
                                {/*<PaymentCardInfo/>*/}
                            Hello
                            </div>
                            {/*  test transaction */}
                            <div key="radioList" data-grid={{x: 0, y: 1, w: 2, h: 1, static: true}}>
                                {/*<RideSharingModule callback={this.updateState} data={this.state} updateCallback={this.updateType}/>*/}
                            wassup
                            </div>
                        </GridLayout>
                        <h1>
                            Fix purchase
                        </h1>
                        <br/>
                    </Container>
                </div>
            </div>
        );
    }

    render() {
        return this.LoggedInPage();
    }
}
